import React, { useState, useEffect } from "react";
import axios from "axios";

const RealTimeApi = (props) => {
  const [state, setState] = useState({ response_text: [{}] });
  useEffect(() => {
    axios
      .get("/api/real_time_api")
      .then((res) => console.log(resp.data), setState(res.data));
  }, []);

  console.log(state.response_text);

  return (
    <div>
      <p>Information from rtpi:</p>
      <p>{state.response_text}</p>
    </div>
  );
};

export default RealTimeApi;
